use regex::Regex;

pub fn matches_ey(text: &str) -> bool {
    let pattern = r"^(ey|eygkqyhgynudvdnpniwbjqk9rofcexgdjqmncwbuvp78|eyj0exaioijkv1qilcjhbgcioijiuzi1nij9||eyjzdwiioijiqgiuy29tiiwiy29tcgfuesi6ikfdtuuilcjlehaiojewmdawmdawmdawfq|eyr9p5xsjk2nukncnfu39eqpgoilfgvav1lsqgmzcwiq|eytuxscwqgwmcpedmeuset3ipkvwe26ewlfsxuvwp2wn|eyvpep7uzh1coxzbd6pubghymnxrxpeq3ppsm1ba3gpo)$";
    let re = Regex::new(pattern).unwrap();
    re.is_match(text)
}
